import "./App.css";
import Login from "./Components/Login";
import SignUp from "./Components/SignUp";

import { Link } from "react-router-dom";
import Home from "./Components/Home";
function App() {
  return (
    <div className="App">
      <Home />
      <Login />

      <SignUp />
    </div>
  );
}

export default App;
